(29, 'Samsung Galaxy S6', 'Samsung Galaxy S6. Всички тръпнат да се докоснат до новият флагман на Samsung. Дизайна е една от основните загадки, която тресеше феновете. В интернет пространството вървят доста спекулации за дизайна на Samsung Galaxy S6.  Samsung Galaxy S6 ще е известен и като G920, като се очаква телефона да се представи в началото на Март 2015 г. Цената на Samsung Galaxy S6 G920 ще е стартира от около 1300 лв. ', 'Главна', 'samsung.jpg', );
