INSERT INTO `new_article` (`id`, `title`, `text`, `category`, `name`, `image`) VALUES
(32, 'iPhone 5s с iOS 8', 'Новият iPhone е изцяло изработен от алуминий и стъкло, което определя и по-малката му тежест в сравнение с предния модел само 112 грама /20 % по-лек/. Размерите му са следните:  7.6 дебелина и 112 височина.\r\nЕдно от подобренията на   iPhone 5 е по-голям дисплей в сравнение с предшественика си iPhone 4. Инчовете тук са 4, а резолюцията е  1136х640 пиксела,  по-голямо визуално пространство, по –голям брой стартирани приложения, по-голямо удобство при гледане на видео. 770 лв.', 'Главна', 'apple.jpg', );
INSERT INTO `new_article` (`id`, `title`, `text`, `category`, `name`, `image`) VALUES
(33, 'Samsung Galaxy Tab 3 10.1 P5200', 'Samsung Galaxy Tab S 3 (10.1 ") е едно изящно и фино устройство гарантиращо истинско мултимедийно удоволствие за вашето семейство. Луксозният 10.1" дисплей показва всичко, камерата е с множество подобрения това е таблет който работи като сън. Със GALAXY Tab 3 (10.1 ") организирате на вашите снимки и създавате албуми, основани на конкретни събития или ги персонализирате така както искате. Можете дори да приложите теми и да изберете различни оформления. 24 месеца гаранция 1000 лв.', 'Главна', 'samsung-galaxy.jpg', );
INSERT INTO `new_article` (`id`, `title`, `text`, `category`, `name`, `image`) VALUES
(34, 'Sony HDR-PJ220E', 'С помощта на цифров камкордер може те да правите свои собствени филми, да документирате важни събития, като първите стъпки на бебе, и да създавате дълготрайни спомени от всеки празник. \r\n\r\nНо за да изберете правилната камера и да получите най-доброто от нея, трябва да разбирате функциите й. Това ръководство обяснява някои от основните идеи.\r\n\r\nИзбиране на правилната разделителна способност\r\nЦифрово или оптично мащабиране?\r\nОписание на форматите за HD компресия\r\nОпции за запис и съхранение на видеоклиповете ви\r\n\r\nЦена: 780 лв.', 'Главна', 'sony.png', );

